description:
&quot;Wolverine is a mutant with an unbreakable skeleton, retractable adamantium claws, and a healing ability that reverses nearly any wound. His past however, is shrouded in mystery. Calling himself Logan, Wolverine has spent years trying to unravel the layers of his own history. Will Domino, a female mutant with luck abilities help Wolverine stitch together the threads of his past? And what about the insidious Sabretooth... Can Wolverine help Domino find him? They track Wolverine's more brutal counterpart, but must face Lady Deathstrike and Deadpool along the way. The trio prove too much for Wolverine and Domino; it'll take Phoenix and Rogue to save them! All knives are out as Axel Braun presents his new superhero epic, Wolverine!&quot; 

Tommy Gunn, Allie Haze, Aiden Ashley, Andy San Dimas, Asa Akira, Charmane Star, Maya Hills, Derrick Pierce, Evan Stone, Xander Corvus

